import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const XReport = () => {
  const [startHour, setStartHour] = useState(0);
  const [endHour, setEndHour] = useState(23);
  const [reportData, setReportData] = useState([]);
  const navigate = useNavigate();

  const handleGenerateReport = async () => {
    try {
      const response = await axios.get("http://localhost:5050/api/xreport", {
        params: {
          startHour: startHour,
          endHour: endHour,
        },
      });
      setReportData(response.data);
    } catch (err) {
      alert("âŒ Failed to fetch report data.");
    }
  };

  const handleBack = () => {
    navigate(-1); // è·³è½¬å›žä¸Šä¸€é¡µ
  };

  return (
    <div style={{ padding: "20px" }}>
      <button onClick={handleBack} style={{ marginBottom: "10px" }}>
        ðŸ”™ Back
      </button>

      <h2>ðŸ“Š X-Report - Hourly Sales Breakdown</h2>

      <div>
        <label>
          Start Hour:
          <select
            value={startHour}
            onChange={(e) => setStartHour(parseInt(e.target.value))}
          >
            {[...Array(24).keys()].map((hour) => (
              <option key={hour} value={hour}>
                {hour}:00
              </option>
            ))}
          </select>
        </label>
        <label>
          End Hour:
          <select
            value={endHour}
            onChange={(e) => setEndHour(parseInt(e.target.value))}
          >
            {[...Array(24).keys()].map((hour) => (
              <option key={hour} value={hour}>
                {hour}:00
              </option>
            ))}
          </select>
        </label>
        <button onClick={handleGenerateReport}>Generate Report</button>
      </div>

      {reportData.length > 0 && (
        <div style={{ marginTop: "20px" }}>
          <h3>Report Data</h3>
          <table border="1" cellPadding="8" style={{ borderCollapse: "collapse", width: "100%" }}>
            <thead>
              <tr>
                <th>Hour</th>
                <th>Transactions</th>
                <th>Sales Revenue ($)</th>
                <th>Total Sales ($)</th>
                <th>Returns ($)</th>
                <th>Drinks Sold</th>
                <th>Voids ($)</th>
                <th>Discards ($)</th>
                <th>Payment Methods</th>
              </tr>
            </thead>
            <tbody>
              {reportData.map((row, index) => (
                <tr key={index}>
                  <td>{row.hour}</td>
                  <td>{row.total_transactions}</td>
                  <td>{row.sales_revenue}</td>
                  <td>{row.total_sales}</td>
                  <td>{row.total_returns}</td>
                  <td>{row.drink_sales}</td>
                  <td>{row.voids}</td>
                  <td>{row.discards}</td>
                  <td>{row.payment_methods}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default XReport;
